from mnist import MNIST
import random
import numpy as np
import math
import time
mndata = MNIST('C:/Users/win10/Desktop/sample')

images, labels = mndata.load_training()
testImages,testLables = mndata.load_testing()
alpha =  [[0 for i in range(2000)] for j in range(10)]
a = time.time()
for i in range(2000):
    print("iter2 ",i, " and time",time.time() -a )
    max =0
    index = 0
    for j in range(10):
        tmp = 0
        for k in range(2000):
            tmp += alpha[j][k] * math.pow(np.dot(images[i],images[k]) + 1,2)
        if tmp > max:
            max = tmp
            index = j
    if index != labels[i]:
        alpha[index][i] -= 1
        alpha[labels[i]][i] += 1
print(alpha)
#testing
correct = 0
for i in range(1500):
    print("iter ", i, " and time", time.time() - a)
    max =0
    index = 0
    for j in range( 10):
        tmp = 0
        for k in range(2000):
            tmp += alpha[j][k] * math.pow(np.dot(testImages[i],images[k]) + 1,2)
        if tmp > max:
            max = tmp
            index = j
    if index == testLables[i]:
        correct += 1
print("the correctness ratio is: ", correct / 100)
